class UnionFind:
    def __init__(self, n):
        self.parent = list(range(n))
        self.rank = [0] * n
        self.size = [1] * n
  
    def find(self, x):
        if x == self.parent[x]:
            return x
        else:
            #return self.find(self.parent[x])
            self.parent[x] = self.find(self.parent[x]) # path compression
            return self.parent[x]

    def union(self, x, y):
        px = self.find(x)
        py = self.find(y)
        if px == py: return False
        if self.rank[px] < self.rank[py]:
            px,py = py,px
        elif self.rank[px] == self.rank[py]:
            self.rank[px] += 1
        self.parent[py] = self.parent[px]
        self.size[px] += self.size[py]
        return True

class Prime:
    def __init__(self, num):
        self.is_prime = [ True ] * num
        self.smallest_factor = [ 0 ] * num
        self.calc(num)

    def calc(self, num):
        self.is_prime[0] = self.is_prime[1] = False
        for idx in range(2, num, 2):
            self.is_prime[idx] = False
            self.smallest_factor[idx] = 2
        self.is_prime[idx] = True
        for idx in range(3, num, 2):
            if self.is_prime[idx]:
                st = idx**2
                for idx2 in range(st, num, 2*idx):
                    if self.is_prime[idx2]:
                        self.is_prime[idx2] = False
                        self.smallest_factor[idx2] = idx
        for idx in range(3, num, 2):
            if self.is_prime[idx]:
                self.smallest_factor[idx] = idx 
        #print(self.is_prime, self.smallest_factor)

 
class Solution:
    def largestComponentSize(self, A):
        """
        :type A: List[int]
        :rtype: int
        """
        t0 = time.time()
        num = len(A)
        A.sort()
        t1 = time.time()
        print('after A.sort():', t1-t0)
        t0 = t1
        print('len(A):', len(A))
        print('max(A):', A[-1])
        largest = 0
        uf = UnionFind(num)
        prime = Prime(A[-1]+1)
        t1 = time.time()
        print('init prime and uf:', t1-t0)
        t0 = t1
        rec = [-1] * (A[-1]+1)
        for idx in range(num):
            e = A[idx]
            while e > 1:
                f = prime.smallest_factor[e]
                #print('idx, A[idx], factor:', idx, e, f)
                while e%f == 0:
                    e = int(e/f)
                if rec[f] == -1:
                    rec[f] = idx
                else:
                    uf.union(idx, rec[f])
                    #largest = max(largest, uf.size[uf.find(idx)])
        for idx in range(num):
            largest = max(largest, uf.size[uf.find(idx)])
        t1 = time.time()
        print('after two for loop:', t1-t0)
        return largest

